import React from "react";

const Recipe = () => {
  return (
    <div>
      <div>
        <h3>Plain Chicken</h3>
        <button>Edit</button>
        <button>Delete</button>
      </div>
      <div>
        <span>Cook Time:</span>
        <span>1:45</span>
      </div>
      <div>
        <span>Servings:</span>
        <span>5</span>
      </div>
      <div>
        <span>Instructions:</span>
        <div>1. Put salt on chicken 2.</div>
      </div>
    </div>
  );
};

export default Recipe;
